import Link from 'next/link'



export default function Header() {
  return (
    <div>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/projects">
        <a>Projects</a>
      </Link>
      <Link href="/designs">
        <a>Designs</a>
      </Link>
      <Link href="/contact">
        <a>Contact</a>
      </Link>
      <style jsx>{`
        position:fixed;
   padding:0;
   margin:0;

   top:0;
   left:0;

   width: 100%;
   height: 100%;
   background:rgba(255,255,255,0.5);


        padding: 2rem
        a {
          text-decoration: none;
          color: #3B3A3A;
          font-family: 'Arial';
        }
        a:active {
          font-weight: bold;
        }
        a:hover {
          opacity: 0.6;
        }

        `}</style>
    </div>
  )
}
